import React, { Component } from 'react';
import Card from './card';
import Navbar from './navbar';
import Searchbar from './searchbar';
import Optionbar from './select';
import Sortbar from './sortbar';
import Rangebar from './range';

export default class App extends Component {

    render() {
        return (
        <div> 
            <Navbar/>
            <div className='container-fluid'>
                <div className='row mt-5'>
                    <div className='col-2 border-right ml-5 mr-5'>
                        <Searchbar/>
                        <Optionbar/>
                        <Rangebar/>
                    </div>
                    <div className='col-8'>
                        <Sortbar/>
                        <div className='row mt-5'>
                            <div className='col'><Card pic='https://i01.appmifile.com/webfile/globalimg/in/cms/5072AF77-5612-2BE9-14A5-A578EB04B43A.jpg' title='Redmi Note 9 Pro' price='&#x20B9; 16,999'/></div>
                            <div className='col'><Card pic='https://i01.appmifile.com/webfile/globalimg/in/cms/58F356D1-538B-E4C7-0D9E-5266A9306F8E.jpg' title='Redmi Note 8 Pro' price='&#x20B9; 14,999'/></div>
                            <div className='col'><Card pic='https://i1.wp.com/www.mobilebd.co/wp-content/uploads/2020/09/Realme-7-Pro-.png?fit=500%2C500&ssl=1' title='Realme 7 Pro' price='&#x20B9; 17,999'/></div>
                            <div className='col'><Card pic='https://image01.realme.net/general/20191128/1574924102500.jpg' title='Realme X' price='&#x20B9; 14,999'/></div>
                            <div className='col'><Card pic='https://images.ctfassets.net/wcfotm6rrl7u/1P6zIW3DURULcnGTh7xEPS/4930666632731970b1828349612aa4cc/nokia_9_pureview-specs_popup-desktop.png' title='Nokia 9 PureView' price='&#x20B9; 49,999'/></div>
                            <div className='col'><Card pic='https://images.ctfassets.net/wcfotm6rrl7u/3RLuNAWgyZYwisfwIqLg6D/cb51903d4745863dcf2d1ffe8a45d8ba/nokia_8_3-og.jpg' title='Nokia 8.3 5G' price='&#x20B9; 34,999'/></div>
                        </div>
                        <div className='row mt-5'>
                            <div className='col'><Card pic='https://images.indianexpress.com/2019/11/Moto-Razr-2019-FB-1.jpg' title='Moto Razr' price='&#x20B9; 55,999' /></div>
                            <div className='col'><Card pic='https://phoneaqua.com/products/Motorola-Edge-Plus.jpg' title='Motorola Edge Plus' price='&#x20B9; 70,999'/></div>
                            <div className='col'><Card pic='https://cdn57.androidauthority.net/wp-content/uploads/2020/07/samsung-galaxy-z-fold-2-mysmartprice.jpg' title='Samsung Galaxy Z Fold' price='&#x20B9; 89,999'/></div>
                            <div className='col'><Card pic='https://images.samsung.com/nz/smartphones/galaxy-note20/buy/005-galaxynote20-mysticgreen-mo-720.jpg' title='Samsung Galaxy Note 20 Ultra' price='&#x20B9; 1,10,999'/></div>
                            <div className='col'><Card pic='https://www.gizbot.com/images/2020-10/oneplus-8t-5g-review_160275223500.jpg' title='OnePlus 8T' price='&#x20B9; 55,999'/></div>
                            <div className='col'><Card pic='https://images-na.ssl-images-amazon.com/images/I/719CgfLcqNL._SX679_.jpg' title='OnePlus Nord' price='&#x20B9; 25,999'/></div>
                        </div>
                    </div>
                </div>
            </div>
        </div>);
        };
}
